import React, { useEffect,useState } from 'react';

const TableData = () => {
   
    const [user,setUser]=useState(false);
    useEffect(() => {
        
        fetch('/about')
            .then(res => res.json())
            .then(async (data) => {
                // await console.log(data)
                console.log('done')
                setUser(user);
                


                // setShow(true);
            })
    }, []);

    return (

        <>
            <h1>{user}</h1>
        </>
    );
};

export default TableData;
